function Modal(props) {
  [isModalOpen, setIsModalOpen] = useState(false);
  return (
    <div className="modal">
      <p>Really want to delete?</p>
      <button className="btn btn--alt">Yes</button>
      <button className="btn">No</button>
    </div>
  );
}

export default Modal;
